import * as React from 'react';
import { Radio, RadioGroup, FormControl, FormControlLabel, FormLabel } from '@mui/material';

export default function FormControlLabelPosition() {
  const [selectedValue, setSelectedValue] = React.useState('');

  const handleChange = (event) => {
    setSelectedValue(event.target.value);
  };

  return (
    <FormControl component="fieldset">
      <FormLabel component="legend">Елки</FormLabel>
      <RadioGroup aria-label="position" name="position" value={selectedValue} onChange={handleChange} row>
        <FormControlLabel
          value="Литые елки"
          control={<Radio size="small" style={{ marginLeft: '10px' }} />}
          label="Литые елки"
          labelPlacement="end"
        />
        <FormControlLabel
          value="Уличные елки"
          control={<Radio size="small" style={{ marginLeft: '10px' }} />}
          label="Уличные елки"
          labelPlacement="end"
        />
        <FormControlLabel
          value="Елки с лампочками"
          control={<Radio size="small" style={{ marginLeft: '10px' }} />}
          label="Елки с лампочками"
          labelPlacement="end"
        />
        <FormControlLabel
          value="Заснежные елки"
          control={<Radio size="small" style={{ marginLeft: '10px' }} />}
          label="Заснежные елки"
          labelPlacement="end"
        />
        <FormControlLabel
          value="Комбинированные елки"
          control={<Radio size="small" style={{ marginLeft: '10px' }} />}
          label="Комбинированные елки"
          labelPlacement="end"
        />
      </RadioGroup>
    </FormControl>
  );
}
